The major disagreement between past proposals is whether to use "yield expressions" or "magic mutation". Yield expression: let after = yield output; Used by eRFC-2033 Magic mutation: let before = arg; yield output; let after = arg; Used by RFC-2781 and MCP-49 Many people have a strong gut preference for yield expressions. In simple cases, Rust generally prefers to produce values as output from expressions rather than by mutation of state. "Yield expressions feel more Rusty." However, magic mutation is likely correct, even though at first glance it feels surprising. In addition to reasons below, holding references to past resume args is rare, often a logic error. Rust can use mutation checks to catch and give feedback. "Magic mutation" is a bit of a misnomer. The resume argument values are not themselves being mutated. The argument bindings are simply being reassigned across yields. In a sense, argument bindings are reassigned in the exact same way across returns. Previous arguments (if unmoved) are dropped prior to yielding and are reassigned after resuming. People will get yelled at by the borrow checker if they try to hold borrows of arguments across yields. But the fix is generally easy: move the argument to a new binding before yielding. => |x| { let y = &x; yield; dbg!(y, x);
} error[E0506]: cannot pass new `x` because it is borrowed --> src/lib.rs:3:4 |
2 | let y = &x; | -- borrow of `x` occurs here
3 | yield; | ^^^^^ assignment to borrowed `x` occurs here
4 | dbg!(y, x); | - borrow later used here | = help: consider moving `x` into a new binding before borrowing => |x| { let a = x; let y = &a; yield; dbg!(y, x);
} Magic mutation could be replaced by "magic shadowing" where new arguments shadow old ones at yield in order to allow easy borrowing of past argument values. But this is a huge footgun. See if you can spot the issue with the following code if ctx shadows its past value rather than overwriting it: std::future::from_fn(|ctx| { if is_blocked() { register_waker(ctx); yield Pending; } while let Pending = task.poll(ctx) { .. }
}) "Yield expression" causes problems with first-resume input. eRFC-2033 passes the first resume argument via a closure parameters while later arguments are produced by yield expressions. This part of why it is so hard to unify generalized coroutines with a generator syntax like gen { } or gen fn. Where does the first input go? Where do you annotate the argument type even? To increase clarity, users almost always want resume arguments to be named. With magic mutation, all resume arguments are already named since they reuse the closures arguments on every resume. Any unmoved arguments are dropped just prior to yielding, so they are not witnessed and do not increase the coroutine size. Also get multiple arguments for free if using the Fn* traits. Yield expressions require users to repeatedly assign resume arguments to named bindings manually. Such bindings must be included in the closure state if they have any drop logic.

