// ^^^^^^^^^^^^^^ `x` escapes the closure body here yield; }
} As of writing, eRFC-2033 appears to take a similar approach (although the error message is not super descriptive). Ideally someday we'd do something nicer but any such solution would apply to both captured state and witnessed state in the same way.

