RFC-2781 and eRFC-2033 propose that yield x should produce GeneratorState::Yielded(x) or equivalent as an output, in order to discriminate between yielded and returned values. MCP-49 instead gives yield x and return x nearly identical semantics and output x directly, so the two must return the same type. Enum-wrapping here is analogous to Ok-wrapping elsewhere. Similar debates result. When using enum-wrapping, the syntax to specify distinct return/yield types is hotly debated. Generators always want return and yield to have different types (() vs T) but a generator syntax on top of coroutines could be used to auto-insert enum wrappers around yield vs return arguments. Auto-enum-wrapping can slightly improve type safety in some cases where return should be treated specially to avoid bugs. No-enum-wrapping when combined with the impl Fn* choice of trait, allow the coroutine syntax to be used directly with existing higher-order methods on iterator, stream, collection types, async traits, etc. Note these two approaches are "isomorphic": a coroutine that returns GeneratorState<T, T> could be wrapped to return T by some sort of combinator and a coroutine that only returns T can have yield and return values manually wrapped in GeneratorState. This is just about ergonomics: // Without enum wrapping:
std::iter::from_fn(|| { yield Some(1); yield Some(2); yield Some(3); None
}).map(|x| { yield -x; yield x;
}); // With enum wrapping:
std::iter::from_gen_fn(|| { yield 1; yield 2; yield 3;
}).map(unwrap_gen_state(|x| { yield -x; yield x;
})); // Needed for un-enum-wrapping when not desired.
// Could be replaced by sufficiently fancy !-casting?
fn unwrap_gen_state<T>(f: impl FnMut() -> GeneratorState<T, !>) -> T { ... }
fn merge_gen_state<T>(f: impl FnMut() -> GeneratorState<T, T>) -> T { ... } // With no wrapping + generators:
(gen { yield 1; yield 2; yield 3;
}).map(|x| { yield -x; yield x;
})

