I am aware of no strong proposal for an async version of generalized coroutines although a fair amount of discussion has taken place. In the context of MCP-49 , how should async || { ... yield ...} be handled in the very long-term? Error right now. Async coroutines don't make much sense because of resume arguments. Async functions are already coroutines which take an &mut Context as a resume argument. How should additional arguments should be specified? Do the additional args need to be passed every single poll or are they only needed when resuming after Ready? If they are stored between Readys, how does that interact with the ban on witnessing external borrows? Badly. On resume, the the coroutine might only take the additional arguments. It could then yield a future to take the async context and handle any Pending yields. If so, how is the coroutine body broken up into distinct futures to be yielded? What happens if a yielded future is destroyed early? Panic on resume? Generators and async are both sugars on top of coroutines and are orthogonal to each other. But neither is orthogonal to the underlying coroutine feature: // an async block
async { "hello"
} // an async generator
async gen { yield "hello";
} // an "async coroutine"
|ctx: &mut Context| { yield Poll::Ready("hello");
} Taking the async context explicitly makes it cleaner to implement some complex async functions which take additional poll parameters. An await_with! macro would be quite useful for implementing await loops on arbitrary Poll-returning functions. Would be a good candidate for an .await(args..) syntax if very heavily used. For example, an simple little checksumming async write wrapper might look like this: |ctx: &mut Context, bytes: &[u8]| -> Poll<usize> { let mut checksum = 0; let mut count = 0; pin_mut!(writer); loop { let n = 4096 - count; if n == 0 { await_with!(writer.poll_write, ctx, &[checksum]); } let part = &bytes[..bytes.len().min(n)]; checksum = part.fold(checksum, |x, &y| x ^ y); await_with!(writer.poll_write, ctx, part); count += part.len(); yield Ready(part.len()); }
}

