Rust's version of coroutines can be a bit unusual compared to other languages. But the reason for this is simple: you need arguments to resume Rusty coroutines. Resume arguments in other languages can be passed just fine by sharing mutable data. So all they need to implement are generators, not true coroutines as defined here. # Generator function takes a word list and name on construction.
# The shared list is mutated to make room for new words.
def write_greeting(name, words): words.append('hello') if words.is_full: yield words.append(name) // Function only needs name to construct coroutine.
// Coroutine gets mutable access to the word list each resume.
fn write_greeting(name: String) -> impl FnMut(&mut Vec<String>) { |words| { words.push("hello".to_string()); if words.len() == words.capacity() { yield } words.push(name); }
}

