So far in this proposal, I've been very careful to distinguish generators (as supported by the propane and async_stream crates, proposed by RFC-2996 , etc) from the coroutines discussed here. They are treated as two separate language features. Does Rust have "room" for both stream syntax and a generator syntax? Would it be better to find a single solution to both? A single solution is difficult for a few reasons: Taking resume arguments muddies the syntax. For example, what would be the syntax for a generator function which takes an explicit resume argument? The closure syntax works great for coroutines which implement Fn* a la MCP-49 ! But reusing that syntax to magically implement Iterator or Stream would cause confusion. On that note, generators definitely want to implement different traits vs coroutines. Iterator and Stream rather than Fn or (ironically) Generator. As stated above, async coroutines don't make much sense: async interacts poorly with resume arguments. Async generators are super important, don't care about resume arguments. As mentioned in the section on try, generators and coroutines generally want different error handling. Or at lest, some more complex ? desugar is not so obvious for coroutines in general as it is for generators specifically. Once generalized coroutines are in place, a generator syntax like the one in RFC-2996 is a trivial sugar on top: gen { for item in inner { for mapped in func(item) { yield mapped; } }
} // becomes std::iter::from_fn(|| { for item in inner { for mapped in func(item) { yield Some(mapped); } } None
}) async gen { while let Some(item) = inner.next().await { yield func(item).await; }
} // becomes std::stream::from_fn(|ctx| { while let Some(item) = await_with!(inner.next(), ctx) { yield Ready(Some(await_with!(func(item), ctx))); } Ready(None)
}) Proc-macro crates could provide very satisfactory gen and gen_async macros until we are sure of the need to support such a sugar directly in language as a keyword or in core as a first-party macro.
